css:
@-moz-document domain("cifraclub.com.br") {
body, .btn, label, li, a { 
  background: #333 !important;
}
* {
  color: white !important;
}
.cifra_cnt {
  column-count: 2;
}
.cifra_cnt b {
  color: #f70 !important;
  font-weight: normal !important;
}
.g-1 {
  width: 96vw !important;
}
.g-side-ad {
  width: calc(100% - 120px) !important;
}
#js-players, .js-banner-player, .modal, .cifra-creditos, header, #breadcrumb, .pub {
  display: none !important;
}
.w-content {
  padding: 0 !important;
}
}
